import React, { useState } from "react";

const Home=()=>{
    const[count,setcount]=useState(0);
       
    const counting=()=>{
      setcount(count+1);
    }

    return(
      <div>
        <h1 style={{just}}>{count}</h1>
       <button onClick={counting}>CLICKME</button>
      </div>  
    );
}

export default Home;
